/*Table structure for table `t_product_category` */

DROP TABLE IF EXISTS `t_product_category`;

CREATE TABLE `t_product_category` (
  `id` int NOT NULL COMMENT '主键',
  `parent_id` bigint DEFAULT NULL COMMENT '父分类id',
  `name` varchar(150) DEFAULT NULL COMMENT '名称',
  `status` int DEFAULT '1' COMMENT '状态   1：正常   0：删除',
  `sort_order` int DEFAULT NULL COMMENT '排序号',
  `is_parent` int DEFAULT NULL COMMENT '是否是父分类   1：是  0：否',
  `created_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modified_time` datetime DEFAULT NULL COMMENT '最后修改时间',
  `created_user` varchar(50) DEFAULT NULL COMMENT '创建人',
  `modified_user` varchar(50) DEFAULT NULL COMMENT '最后修改人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3;

